<script>
const axios = require("axios").default;
export default {
  // name: "Profile",
  data() {
    return {
      base64: null,
    };
  },
  methods: {
    document() {
      let pageWidth = 610;
      let pageHeight = 810;
      let docDefinition = {
        pageSize: "A4",
        background: [
          {
            margin: [0, 15],
            image:
              "data:image/png;base64,",
            width: pageWidth,
            height: pageHeight,
          },
        ],
        pageMargins: [ 40, 60, 40, 85 ],
        footer: {
          columns: [
            {
              text: '',
              width: 250,
            },
            {
              stack: [
                {
                  text: this.$t('document.doer') + ":",
                  margin: 3
                },
                {
                  text: this.$t('document.phone') + ":",
                  margin: 3
                }
              ],
              fontSize: 10,
              width: 150,
            },
            {
              text: '',
              // width: 200,
            },
          ],
        },
        content: [
          {
            alignments: "justify",
            columns: [
              {
                image:
                  "data:image/jpeg;base64,",
                fit: [130, 130],
                margin: [95, 35, 10, 20],
              },
              {
                image:
                  "data:image/png;base64,",

                fit: [150, 150],
                margin: [105, 10, 10, 0],
              },
            ],
          },
          {
            text: "№",
            margin: [20, 20, 10, 0],
          },
        ],
        defaultStyle: {
          font: "Times",
        },
      };
    },
    getList() {
      this.loading = true;
      this.attributes = [];
      this.document = {};
      axios
        .post(this.$store.state.backend_url + "api/documents/show-document", {
          id: this.id,
          language: this.$i18n.locale,
        })
        .then((res) => {
          this.document = res.data.document;
          this.from_departament = res.data.from_departament;
          this.getDocumentDetailTemplate();
          this.document_locale = this.document.locale
            ? this.document.locale
            : this.$i18n.locale;
          this.resolution.document_id = this.document.id;
          // console.log(this.document);
          this.resolution.sequence = this.document.sequence;
          this.document.document_details.forEach((document_detail, i_detail) => {
            document_detail.document_detail_attribute_values.forEach(
              (element, index_att) => {
                if (element.table_lists && element.table_lists.length) {
                  let colums = element.document_detail_attributes.table_list.column_name.split(
                    ", "
                  );
                  let table_view =
                    element.document_detail_attributes.table_list.table_view;
                  // console.log(colums);
                  // element.attribute_value = Number(element.attribute_value);
                  // if (is_locale) {
                  //   element.attribute_value = element.table_lists.find(
                  //     (v) => v.id == element.attribute_value
                  //   )[colums[0] + "_" + this.$i18n.locale];
                  // } else {
                  if (table_view) {
                    // console.log(colums);
                    // this.document.document_details[
                    //   i_detail
                    // ].document_detail_attribute_values.splice(index_att, 1);
                    let new_array = [];
                    colums.forEach((colum) => {
                      let colum_att = colum.replace("locale", this.document_locale);
                      let colum_name = colum.replace("_locale", "");

                      new_array.push({
                        attribute_value: element.table_lists.find(
                          (v) => v.id == element.attribute_value
                        )[colum_att],
                        document_detail_attributes: {
                          ["attribute_name_" + this.document_locale]: this.$t(
                            element.document_detail_attributes.table_list.table_name +
                              "." +
                              colum_name,
                            this.document_locale
                          ),
                          sequence: element.document_detail_attributes.sequence,
                          is_list_vertical:
                            element.document_detail_attributes.is_list_vertical,
                        },
                      });
                      // console.log(new_array)
                    });
                    this.document.document_details[
                      i_detail
                    ].document_detail_attribute_values = new_array.concat(
                      this.document.document_details[i_detail]
                        .document_detail_attribute_values
                    );
                  } else {
                    let new_attribute = "";
                    colums.forEach((colum) => {
                      colum = colum.replace("locale", this.document_locale);
                      new_attribute =
                        new_attribute +
                        " " +
                        element.table_lists.find(
                          (v) => v.id == Number(element.attribute_value)
                        )[colum];
                    });
                    element.attribute_value = new_attribute;
                  }
                }
              }
            );
          });
          this.disableresolution = res.data.document.disable_resolution
            ? res.data.document.disable_resolution
            : false;
          this.reaction_comment = res.data.document.reaction_comment
            ? res.data.document.reaction_comment
            : "";
          this.reaction_status = res.data.document.reaction_status
            ? res.data.document.reaction_status
            : 0;

          this.document.document_signers.sort((a, b) => {
            return (
              a.staff.department.department_code - b.staff.department.department_code
            );
          });
          this.document.document_signers.sort((a, b) => {
            return a.sequence - b.sequence;
          });

          this.document.document_details.map((document_detail, index_detail) => {
            let arrs = [];
            document_detail.document_detail_attribute_values.map(
              (d_d_attribute_value, index_att) => {
                arrs.push({
                  id: d_d_attribute_value.id,
                  attribute_value: d_d_attribute_value.attribute_value,
                  document_detail_attributes:
                    d_d_attribute_value.document_detail_attributes,
                  sequence: d_d_attribute_value.document_detail_attributes.sequence,
                  is_list_vertical:
                    d_d_attribute_value.document_detail_attributes.is_list_vertical,
                });
                // this.attributes[index_detail][d_d_attribute_value.document_detail_attributes.sequence].push(d_d_attribute_value);
              }
            );
            // console.log(arrs);
            let result = arrs.reduce(function (r, a) {
              r[a.sequence] = r[a.sequence] || [];
              r[a.sequence].push(a);
              return r;
            }, Object.create(null));

            // console.log(result);
            this.attributes.push(result);
          });
          this.documentFiles = res.data.document_files;
          this.documentDoer = res.data.document_doer;
          // this.getResolutionEmployees();

          this.loading = false;
          // console.log(this.user.employee_id);
          // this.processing();
          this.refreshDocument();
        })
        .catch((err) => {
          console.log(err);
          window.history.back();
          this.loading = false;
        });
    },
  },
  mounted() {
    this.document();
  },
};
</script>
